import React from 'react';
import {Link} from "react-router-dom";
import homeStyles from '../../style/home/home.module.css'

const Home = () => {
	return (
		<div className={homeStyles.entire}>
			<nav>
				<Link to="edit" className={link.link}>Edit</Link>
				<Link to="draft" className={link.link}>Drafts</Link>
				<Link to="published" className={link.link}>Published</Link>
				<Link to="involved" className={link.link}>Involved</Link>
				<Link to="profile" className={link.link}>Profile</Link>
				<Link to="setting" className={link.link}>Setting</Link>
			</nav>
		</div>
	);
};

export default Home;
